import React from 'react';
import styled from 'styled-components';
import Logo from '../../Images/Logo/SpinzerLogoGolgenSilver.png';

const FooterDiv=styled.div`
width: 100vw;
height: 30vh;
background-color: #000d1a;

`;
const Footer = () => {
    return (
       <FooterDiv>
           <img src={Logo}/>
       </FooterDiv>
    )
}

export default Footer
